package com.everlive.user.bo;import java.util.Date;public class UserStarStatus {		private Integer userId;	private String status;	private Date password;	public Integer getUserId() {		return userId;	}	public void setUserId(Integer userId) {		this.userId = userId;	}	public String getStatus() {		return status;	}	public void setStatus(String status) {		this.status = status;	}	public Date getPassword() {		return password;	}	public void setPassword(Date password) {		this.password = password;	}		}